import "./App.css";
import Container from "@material-ui/core/Container";
import Box from "@material-ui/core/Box";
import AForm from "./components/aForm";
import ASection from "./components/aSection";

function App() {
  return (
    <div className="App">
      <Box width="100">
        <ASection title="Test Form">
          <AForm />
        </ASection>
      </Box>
    </div>
  );
}

export default App;
